def GetContent(url, refer=ROOT_URL):
    #该函数获取url对应的内容，并用BeautifulSoup处理，最后返回一个BeautifulSoup对象
    headers = {'User-Agent':"Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.1 (KHTML, like Gecko) Chrome/22.0.1207.1 Safari/537.1"}##浏览器请求头（大部分网站没有这个请求头会报错、请务必加上哦）
    headers['Referer'] = refer
    
    try:
        html_get = requests.get(url, headers=headers)    
        return html_get
    except:
        print('Error:'+'Get Content from '+str(url)+' ERROR')
        time.sleep(3)
        try:
            html_get = requests.get(url, headers=headers)    
            html_get.encoding='utf-8'
            return html_get
        except:
            print('Error[2nd]:'+'Get Content from '+str(url)+' ERROR')
            return 0

def short_to_long(shorturl):

    print('短连接 '+shorturl)
    link = ForceGetLink(shorturl)
    title=''
    req = GetContent(link)
    soup = BeautifulSoup(req.text, 'lxml')
    title = soup.select_one("#lrbox > div.left > font:nth-of-type(3)").text
    #DownloadFile(link, filename)
    print(title)
    print('长链接 '+link)
    with open('long_link_tuigirl.txt','r') as f:
        a = f.read()
        split_a = a.split(sep='\n')
    mark = 1
    for j in split_a:
        if link == j:
            print('已有记录，continue咯')
            mark = 0
    if mark == 1:        
        with open('long_link_tuigirl.txt','a') as f:
            f.write(title+'\n')
            f.write(link+'\n')
